import './home.less'
import  memoryUtil  from '../../utils/memoryUtil'
import {lazy, Suspense} from 'react'
import { Redirect, Switch, Route} from 'react-router-dom';
import { Layout } from 'antd';
import SideNav from '../../components/SideNav';
import Loading from '../../components/Loading'
import Aaaa from '../contents/Dashboard'
// import Dashboard from'../contents/Dashboard';
// import Students from'../contents/Students';
// import Schools from'../contents/Schools';
// import Volunteers from'../contents/Volunteers';
// import Events from'../contents/Events';
// import Download from'../contents/Download';

const { Header, Footer, Sider, Content } = Layout;
export default function Home(props) {
    const user = memoryUtil.user;
    if (!user || !user._id) return <Redirect to="/login" />

    function lazyLoads(src){
      const component = lazy(()=>import(src))
      return component
    }
    const Dashboard = lazy(()=>import('../contents/Dashboard'))
    const Student = lazy(()=>import('../contents/Students'))
    const Schools = lazy(()=>import('../contents/Schools'))
    const Volunteers = lazy(()=>import('../contents/Volunteers'))
    const Events = lazy(()=>import('../contents/Events'))
    const Users = lazy(()=>import('../contents/Users'))
    const Download = lazy(()=>import('../contents/Download'))

        
    return (
      
        <Layout className='layout'>
      <Sider className='sider' width="4rem" style={{backgroundColor:'transparent'}}  >
          <SideNav />
      </Sider>
      <Layout>
        <Header style={{backgroundColor:'#E7EAED'}} >Header</Header>
        <Content style={{backgroundColor:'white'}}>
          
          <Switch>
          <Suspense fallback={ <Loading/> } >
            <Route path='/dashboard' component= {Dashboard} />   
            <Route path='/students' component= {S} />   
        </Suspense>

          </Switch>


        </Content>
        <Footer>Footer</Footer>
      </Layout>
    </Layout>
    )

}
